<?phpnamespace Nemundo\Bfs;use Nemundo\App\Composer\Library\ComposerLibrary;use Nemundo\Content\ContentProject;use Nemundo\Core\Path\Path;use Nemundo\Project\AbstractProject;class BfsProject extends AbstractProject{    public function loadProject()    {        $this->project = 'Bfs';        $this->projectName = 'bfs';        $this->path = __DIR__;        $this->namespace = __NAMESPACE__;        $this->modelPath = (new Path())            ->addPath(__DIR__)            ->addParentPath()            ->addPath('model')            ->getPath();        $this->addDependency(new ContentProject());        $this->addComposer(ComposerLibrary::EXCEL);    }}